    false,nt"url": null,nt"notes": "Benthic habitat polygon coverages are being
    created for the Olympic Coast national marine sanctuary (OCNMS).ROV, towed camera
    sled, bathymetry data, sedimentary samples, and sonar mapping have been integrated
    to describe thegeological, biological, and oceanographic aspects of habitat. OCNMS
    has collected side scan sonar and video data toproduce polygon coverages. The habitat
    polygons have abbributes for megahabitat, bottom induration, mesohabitat,macrohabitat
    and biology (where direct observations are available), polygon area and perimeter.",nt"license_title":
